import React, { Fragment } from 'react';
import './App.css';
import SignIn from './component/SignIn';
import SignUp from './component/SignUp';

function App() {
  return (
    <Fragment>
      <div>
        <SignIn/>
      </div>
      <hr/>
      <div>
        <SignUp/>
      </div>
      <div>
        <TaskManager/>
      </div>
    </Fragment>
  );
}

export default App;
